import React from 'react';
import './header.css';

const Header = () => {
  return (
    <header className="header">
      <h1>Taskify</h1>
      <div className="user-info">
      <button><i id='' className="bi bi-person-circle"></i></button>
        <button>Log Out</button>
      </div>
    </header>
  );
};

export default Header;
